import React from 'react';
import styled from 'styled-components';

const Img=styled.img`
  object-fit:cover;
  width:100%;
  height:56px;
  border-radius:50%;
  border:solid 3px transparent;
  background-image: linear-gradient(to right, red 0%, orange 100%);
  border-image-slice: 1;
  overflow:hidden;
  display:inline-block;
`
const Div=styled.div`
  padding: 0 4px;
  height:122px;
`
const Canvas=styled.canvas`
  position:absolute;
  width:66px;
  height:66px;
`
const Span=styled.span`
  width:56px;
  height:56px;
`
const Name=styled.div`
  font-size:12px;
  color:#262626;
  overflow:hidden;
  margin-top:5px;
  text-overflow:ellipsis;
`
function StoryEle() {
  return (
   <Div>
    <button>
      <div>
        <Canvas>
          <Span>
            <img src='images/activeStatus/photo.png'/>
          </Span>
        </Canvas>
      </div>
    </button>
   </Div>
  );
}

export default StoryEle;
